import React from 'react';

const Projects: React.FC = () => {
  const projectList = [
    {
      title: 'Portfolio Website',
      description: 'A personal portfolio website built with React, TypeScript, and Tailwind CSS.',
      liveDemo: 'https://your-portfolio-live-demo.com', // Replace with your live demo link
      sourceCode: 'https://github.com/yourusername/portfolio-website', // Replace with your GitHub repo link
    },
    {
      title: 'Weather App',
      description: 'A weather forecasting app using OpenWeather API and React.',
      liveDemo: 'https://your-weather-app-live-demo.com', // Replace with your live demo link
      sourceCode: 'https://github.com/yourusername/weather-app', // Replace with your GitHub repo link
    },
    {
      title: 'E-commerce Store',
      description: 'A fully functional e-commerce store built with React and Firebase.',
      liveDemo: 'https://your-ecommerce-live-demo.com', // Replace with your live demo link
      sourceCode: 'https://github.com/yourusername/ecommerce-store', // Replace with your GitHub repo link
    },
  ];

  return (
    <div className="container mx-auto text-center py-10">
      <h1 className="text-4xl font-bold mb-6 text-blue-600 dark:text-blue-400">My Projects</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {projectList.map((project, index) => (
          <div
            key={index}
            className="bg-white dark:bg-gray-800 shadow-md rounded-lg p-6 hover:shadow-lg transition-shadow duration-300"
          >
            <h2 className="text-2xl font-bold mb-2 text-gray-800 dark:text-gray-200">{project.title}</h2>
            <p className="text-gray-700 dark:text-gray-400 mb-4">{project.description}</p>
            <a
              href={project.liveDemo}
              target="_blank"
              rel="noopener noreferrer"
              className="text-blue-500 dark:text-blue-400 hover:underline mr-4"
            >
              Live Demo
            </a>
            <a
              href={project.sourceCode}
              target="_blank"
              rel="noopener noreferrer"
              className="text-blue-500 dark:text-blue-400 hover:underline"
            >
              Source Code
            </a>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Projects;
